import React from "react";
import Nav from "./Nav";
import Header from "./Header"
import Main from "./Main"
import Footer from "./Footer";

function Body() {
  return (
    <div className="App container">
      <div class="row">
        <div class="col-4"><Nav/>
        </div>
        <div class="col-8">
        <Header/>
        <div class="row"> <Main/></div>


        </div>
      </div><Footer/>
    </div>
  );
}

export default Body;
